import './App.css';
import ReactDOM from 'react-dom'
import React from 'react'
import { render } from "react-dom";

const elements = [
  {
      tag: "h1",
      attributes: null,
      value: "Webpage Title"
  },
  {
      tag: "p",
      attributes: null,
      value: "Hey"
  },
  {
      tag: "h1",
      attributes: {
          name: "Check out my GitHub!",
          link: "https://github.com/AJarombek"
      },
      value: "Ok"
  }
];

elements.push({

    tag: "h1",
    attributes: null,
    value: "Webpage Title"

})

const App = () =>
    elements.map(e => {
        let Tag = e.tag;


        return (
        <Tag key={e.toString()} {...e.attributes}>
            {e.value}
        </Tag>
        );
    });

ReactDOM.render(<App />, document.getElementById("root"));

export default App;
